import "@fontsource/roboto";
import React from "react";
import { BrowserRouter, Routes } from "react-router-dom";
import "reflect-metadata";
import "./App.css";
import WelcomeView from "./Views/WelcomeView";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route index element={<WelcomeView />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
